import React, { } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useHistory
} from "react-router-dom";

function App() {

  let history = useHistory();

  function handleClick() {
    history.push("/home");
  }

  return (
    <div className="App">


      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">ContentData</Link>
              </li>
              <li>
                <Link to="/about">About</Link>
              </li>
              <li>
                <Link to="/users">Users</Link>
              </li>
            </ul>
          </nav>

          <Switch>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/users">
              <Users />
            </Route>
            <Route path="/">
              <Home />
              <button type="button" onClick={handleClick}>
                Go home
    </button>
            </Route>
          </Switch>
        </div>
      </Router>


    </div >
  );
}


function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

export default App;
